export const theme = {
  light: {
    // are primary and accent needed in both, cause youre only giving themeProvider one of em
    primary: '#60b389',

    accent: '#7ccca4',
    complement: '#19211f',
    text: '#ddede8',
  },

  dark: {
    primary: '#60b389',
    accent: '#7ccca4',
    complement: '#19211f',
    text: '#ddede8'
  }
}
